import React from 'react';
import './List.css';
import { Button } from '../../globalStyles';
import { Link } from 'react-router-dom';

import {
  ProjObjOne,
  ProjObjTwo,
  ProjObjThree,
  ProjObjFour,
  SocialObjOne,
  SocialObjTwo,
  SocialObjThree,
  SocialObjFour,
  ArticObjOne,
  ArticObjTwo,
  ArticObjThree,
  ArticObjFour
} from "./Data";

export const List = ({type}) => {
  let DataObjOne;
  let DataObjTwo;
  let DataObjThree;
  let DataObjFour;

  if(type=='proj'){
      DataObjOne = ProjObjOne;
      DataObjTwo = ProjObjTwo;
      DataObjThree = ProjObjThree;
      DataObjFour = ProjObjFour;
  }
  else if(type =='article'){
      DataObjOne = ArticObjOne;
      DataObjTwo = ArticObjTwo;
      DataObjThree = ArticObjThree;
      DataObjFour = ArticObjFour;
  }
  else{
      DataObjOne = SocialObjOne;
      DataObjTwo = SocialObjTwo;
      DataObjThree = SocialObjThree;
      DataObjFour = SocialObjFour;
  }


  return (
    <div class='btn-group'>
     <Link to={{pathname: ProjObjOne.link}} target="_blank"><Button big fontBig primary={primary}>{SocialObjOne.title}</Button></Link>
     <Link to={{pathname: ProjObjTwo.link}}><Button big fontBig primary={primary}>{ProjObjTwo.title}</Button></Link>
     <Link to={{pathname: ProjObjThree.link}}><Button big fontBig primary={primary}>{ProjObjThree.title}</Button></Link>
     <Link to={{pathname: ProjObjFour.link}}><Button big fontBig primary={primary}>{ProjObjFour.title}</Button></Link>
    </div>
  );
};
